    const onChangeMenor = (event) => {
        setMenorValor(event.target.value)
    }

    const onChangeMaior = (event) => {
        setMaiorValor(event.target.value)
    }

    return(
        <BarraNavegacaoStyle>
            FILTRAR POR:
            <label>
            menor preço
            <input
            onChange={onChangeMenor}
            value={menorValor}
            />
            </label>
            <ButtonStyle >filtrar</ButtonStyle>
            <label>
            maior preço
            <input />
            </label>
            <ButtonStyle>filtrar</ButtonStyle>


        </BarraNavegacaoStyle>
    )
}

